C1 – QUESTIONÁRIO DE ACESSO ${idsbx0}  


Esse questionário identifica o nível de acesso existente entre os serviços da rede de atenção aos usuários de drogas. 


Para isso eu vou ler algumas afirmativas sobre à relação do SEU SERVIÇO referentes ao USO DE DROGAS com outros serviços.

D1 – QUESTIONÁRIO DE CONFIANÇA  ${idsbx0} 

Esse questionário identifica o nível de confiança existente entre os serviços da rede de atenção aos usuários de drogas. 

Para isso eu vou ler algumas afirmativas sobre à relação do SEU SERVIÇO referentes ao USO DE DROGAS com outros serviços.
